// src/IndividualContact.js
import React, { useState, useEffect } from 'react';
import { useLocation, Link } from 'react-router-dom';
import { FaCheckSquare, FaBell, FaMoneyBillWave } from 'react-icons/fa';
import { addTodo, getTodos } from './api'; // Assuming API functions are in a separate file
import { fetchContacts, addContact, getContact, updateContact, deleteContact } from './api';


const IndividualContact = () => {
  const location = useLocation();
  const params = new URLSearchParams(location.search);
  const contactId = params.get('id'); // Get contact ID from URL

  const [activeTab, setActiveTab] = useState('todo');
  const [todos, setTodos] = useState([]);
  const [newTodo, setNewTodo] = useState({
    text: '',
    dueDate: '',
    priority: 'Low'
  });

  // Fetch todos on component load
  useEffect(() => {
    const fetchTodos = async () => {
      const fetchedTodos = await getTodos(contactId);
      setTodos(fetchedTodos);
    };
    fetchTodos();
  }, [contactId]);

  const handleAddTodo = async () => {
    const addedTodo = await addTodo(contactId, newTodo);
    setTodos([...todos, addedTodo]);
    setNewTodo({ text: '', dueDate: '', priority: 'Low' });
  };

  const handleInputChange = (e) => {
    setNewTodo({
      ...newTodo,
      [e.target.name]: e.target.value
    });
  };

  return (
    <div className="individual-contact">
      <header className="header">
        <button className="back-button" onClick={() => window.history.back()}>← Contacts</button>
      </header>
      <div className="contact-summary">
        <h2>{params.get('name') || "Contact"}</h2>
      </div>
      <div className="tab-bar">
        {/* Tabs for Todo, Reminder, and Finance */}
      </div>
      <div className="tab-content">
        {activeTab === 'todo' && (
          <div className="todo-content">
            <button className="add-button" onClick={handleAddTodo}>+ Add New Todo</button>
            <div>
              {todos.map((todo, index) => (
                <div key={index} className="list-item">
                  <input type="checkbox" checked={todo.completed} onChange={() => {/* Add handler for completion toggle */}} />
                  <span>{todo.text}</span>
                  <span>{todo.dueDate}</span>
                  <span className={`priority ${todo.priority.toLowerCase()}`}>{todo.priority}</span>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default IndividualContact;
